import {posts} from '../data/post.data'
import styles from './postList.module.css'
function PostList(){
    return(
        <section className={styles.postList}>
            {posts.length ? posts.map(post => (
                <div className={styles.post}>
                    <strong>
                        {post.title}
                    </strong>

                    <span>
                        {post.text}
                    </span>
                </div>
            ))
            : <p> No posts yet! </p>
            }
        </section>
    );
}

export default PostList
